namespace Advent2018;

public partial class Day05 : Advent.Day
{
    /*
        *  Description -   The input is the formula for a molecule.  If two adjacent elements are the same type but opposite polarity (upper and lower case), they annihilate.
        *  
        *  Part 1 -        What length of molecule is left after all annihilations take place?
        *  Part 2 -        What is the shortest possible length of the remaining molecule if all of one given letter (both cases) is removed before processing?
    */
    public Day05(bool testMode, int whichPart, string input) : base(testMode, whichPart, input)
    {
        switch (WhichPart, TestMode)
        {
            case (1, true):
                Inputs.Add("dabAcCaCBAcCcaDA");
                Expecteds.Add("10");
                break;
            case (1, false):
                Inputs.Add("");
                Expecteds.Add("11108");
                break;
            case (2, true):
                Inputs.Add("dabAcCaCBAcCcaDA");
                Expecteds.Add("4");
                break;
            case (2, false):
                Inputs.Add("");
                Expecteds.Add("5094");
                break;
        }
    }
}
